import React from "react";
import "./About.css";

export const About = () => (
  <div className="aboutpage">
    <div className="jumbotron jumbotron-about"></div>
    <div className="abouttext">
        <div className="row">
            <div className="col-2"></div>
            <div className="col-2"></div>
            <div className="col-2"></div>
        </div>
    </div>
  </div>
);
